from PIL import Image, ImageFile
import base64
from io import BytesIO

# Ativa a opção para carregar imagens truncadas
ImageFile.LOAD_TRUNCATED_IMAGES = True

# Cole o código base64 completo aqui
img_base64 = ''

# Decodificar base64 com validação
try:
    img_data = base64.b64decode(img_base64, validate=True)
    img = Image.open(BytesIO(img_data))
    img.show()
except (base64.binascii.Error, OSError) as e:
    print(f"Erro ao carregar a imagem: {e}")